import { useTranslation } from "react-i18next";
import styled from "styled-components";

export const CouponItem = () => {
    //page hook
    const { t } = useTranslation();
    return (
        <StyledContainerTop>
            <div className="name">{t("page.coupon.discount_coupon")}</div>
        </StyledContainerTop>
    );
};

const StyledContainerTop = styled.div`
    background-color: #fff;
    padding: 18px 24px;
    .name {
        font-weight: bold;
        font-size: 20px;
        line-height: 27px;
        /* identical to box height */

        color: #000000;
    }
`;
